import React from 'react';
import styled from 'styled-components';
import CommonTemplate from './components/CommonTemplate';
import iconImage from './globe.svg'; // Update this with your icon image path

const AppContainer = styled.div`
  text-align: center;
`;

const AppHeader = styled.header`
  background: rgba(25, 98, 185, 1);
  height: 97px;
  position: relative; /* Added to position the icon relative to the header */
`;

const AppLogo = styled.img`
  height: 40vmin;
  pointer-events: none;
`;

const Icon = styled.img`
  width: 81px;
  height: 97px;
  position: absolute;
  top: 0;
  left: 0;
`;

function App() {
  return (
    <AppContainer>
      <CommonTemplate>
        <AppHeader>
          <Icon src={iconImage} alt="Icon" />
          {/* Your main content goes here */}
        </AppHeader>
      </CommonTemplate>
    </AppContainer>
  );
}

export default App;
